const ToDo = ({todo, handleCheckCompleted}) => {
    return (
        <li>
            {/* <div> */}
                <input type="checkbox" checked={todo.completed} onChange={() => handleCheckCompleted(todo.id)} />
                {todo.title}
            {/* </div> */}
            <button disabled={!todo.completed} type="button" aria-label='Close'>x</button>
        </li>
    )
};

export default ToDo;
